import React from "react";
import "./style.css";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardSubtitle,
  Button,
  CardFooter
} from "reactstrap";

const Product = ({ item: { title, price, description, img } }) => {
  return (
    <div className="product" style={{ width: "15rem", margin: "1rem" }}>
      <Card>
        <CardImg
          top
          width="100%"
          src={require("../images/Header-Background.jpg")}
          alt="product"
        />
        <CardBody>
          <CardText className="title">{title}</CardText>
          <CardText>{description}</CardText>
          <CardFooter>
            <Button color="info">Add to Cart</Button>
            <CardText className="price">${price}</CardText>
          </CardFooter>
        </CardBody>
      </Card>
    </div>
  );
};

export default Product;
